// ==UserScript==
// @name         Thankful for TorrentBD
// @namespace    https://naeembolchhi.github.io/
// @version      0.9
// @description  Tracks the shoutbox and thanks any new torrents found.
// @author       NaeemBolchhi
// @license      GPL-3.0-or-later
// @icon         data:image/png;base64,
// @match        https://*.torrentbd.com/*
// @match        https://*.torrentbd.net/*
// @match        https://*.torrentbd.org/*
// @match        https://*.torrentbd.me/*
// @require      https://greasyfork.org/scripts/456228-absolute-visibility/code/Absolute%20Visibility.js?version=1125944
// @grant        none
// @run-at       document-end
// @downloadURL https://update.greasyfork.org/scripts/455457/Thankful%20for%20TorrentBD.user.js
// @updateURL https://update.greasyfork.org/scripts/455457/Thankful%20for%20TorrentBD.meta.js
// ==/UserScript==

// Function for Quick Thanks
const localJS = `
function dudeThanks(key) {
	$.ajax({
		url: window.location.origin + "/ajthank.php" + ajaxSuffix,
		type: "POST",
		data: {
			i: key
		},
		dataType: 'json',
		success: ''
	});
}
$(document).ready(function () {
    $('#shout-send-container').off('mouseover');
    $('.shoutbox-container').off('mouseout');
});
`;

// Making function available locally and setting iframe
(function() {
    let body, script, iframe;
    body = document.getElementsByTagName("body")[0];
    if (!body) {window.location.reload();}
    script = document.createElement("script");
    script.setAttribute("type", "text/javascript");
    script.innerHTML = localJS;
    body.appendChild(script);

    if (location.href !== location.origin + "/" && location.href !== location.origin + "/?spotlight") {
        iframe = document.createElement("iframe");
        iframe.setAttribute("style","height:0;width:0;opacity:0;margin:0;padding:0;border:0");
        iframe.src = window.location.origin;
        body.appendChild(iframe);
    }
})();

// Thank on torrent details page
if (location.href.match(/torrents\-details/)) {
    try {
        location.assign("javascript:giveThanks()");
    } catch(e) {}
}

// Confirm page for when shoutbox is visible
if (location.href == location.origin + "/" || location.href == location.origin + "/?spotlight") {
    // Set cookie for expanded Shoutbox
    document.cookie = "hideShoutbox=0";

    // Modifying head when available
    let observer = new MutationObserver(function() {
        let shoutItems = document.querySelectorAll("#shouts-container .shout-item .shout-text a[href*=torrents\-details]");
        for (let x = 0; x < shoutItems.length; x++) {
            let wait = x * 100;
            setTimeout(function() {
                try {
                    location.assign(`javascript:dudeThanks(${parseFloat(shoutItems[x].href.replace("&hit=1","").replace(window.location.origin + "/torrents-details.php?id=",""))})`);
                } catch(e) {}
            }, wait);
        }
        if (document.getElementById("shout-idle-notice")) {
            location.reload();
        }
        //observer.disconnect();
    });
    observer.observe(document.getElementById("shouts-container"), {childList: true});
}